column4:
@nonva my understanding (DYOR) 

is that if a fork occurs, the two networks will split off into different universes - both sides will respect their (shared) history BEFORE the split but will not care at all about what happens on the other chain after the split. So if you have tokens before the fork, you will have two sets of tokens - one on each chain. and what you do with those tokens will not affect the other set of tokens. There will not be any ongoing mirroring of actions after the fork. 

As a practical matter I do not think that a PoW fork will exist for very long and I do not think the value of tokens on that chain will be relevant.

